import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
} = wp.components;

const name = "gb/withparagraphondark";

registerBlockType(name, {
  title: __("With Paragraph On Dark", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "newsletter",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    message: {
      type: "string",
      default: "",
    },
    subject: {
      type: "string",
      default: "",
    },
    to: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUT: { type: "string", default: `  ` },
    contentUA: { type: "string", default: `    ` },
    contentUB: { type: "string", default: `      ` },
    contentUC: { type: "string", default: `Sign up for our newsletter` },
    contentUD: { type: "string", default: `      ` },
    contentUE: {
      type: "string",
      default: `Anim aute id magna aliqua ad ad non deserunt sunt. Qui irure qui Lorem cupidatat commodo. Elit sunt amet fugiat veniam occaecat fugiat.`,
    },
    contentUF: { type: "string", default: `    ` },
    contentUG: { type: "string", default: `    ` },
    contentUH: { type: "string", default: `      ` },
    contentUI: { type: "string", default: `        ` },
    contentUJ: { type: "string", default: `Email address` },
    contentUK: { type: "string", default: `        ` },
    contentUL: { type: "string", default: `        ` },
    contentUM: { type: "string", default: `          ` },
    contentUN: { type: "string", default: `Notify me` },
    contentUO: { type: "string", default: `        ` },
    contentUP: { type: "string", default: `      ` },
    contentUQ: { type: "string", default: `      ` },
    contentUR: {
      type: "string",
      default: `We care about the protection of your data. Read our`,
    },
    contentUS: { type: "string", default: ` Privacy Policy. ` },
    contentt: { type: "string", default: `      ` },
    contentUU: { type: "string", default: `    ` },
    contentUV: { type: "string", default: `  ` },
    contentUW: { type: "string", default: `` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;

    return (
      <div className="bg-gray-800">
         <InspectorControls>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={attributes.to}
                    onChange={(to) => setAttributes({to})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={attributes.subject}
                    onChange={(subject) => setAttributes({subject})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={attributes.message}
                    onChange={(message) => setAttributes({message})}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>

        <RichText
          value={attributes.contentUT}
          default={"  "}
          onChange={(newtext) => setAttributes({ contentUT: newtext })}
        />
        <div className="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8 lg:flex lg:items-center">
          <RichText
            value={attributes.contentUA}
            default={"    "}
            onChange={(newtext) => setAttributes({ contentUA: newtext })}
          />
          <div className="lg:w-0 lg:flex-1">
            <RichText
              value={attributes.contentUB}
              default={"      "}
              onChange={(newtext) => setAttributes({ contentUB: newtext })}
            />
            <h2
              className="text-3xl font-extrabold tracking-tight text-white sm:text-4xl"
              id="newsletter-headline"
            >
              <RichText
                value={attributes.contentUC}
                default={"Sign up for our newsletter"}
                onChange={(newtext) => setAttributes({ contentUC: newtext })}
              />
            </h2>
            <RichText
              value={attributes.contentUD}
              default={"      "}
              onChange={(newtext) => setAttributes({ contentUD: newtext })}
            />
            <p className="mt-3 max-w-3xl text-lg leading-6 text-gray-300">
              <RichText
                value={attributes.contentUE}
                default={
                  "Anim aute id magna aliqua ad ad non deserunt sunt. Qui irure qui Lorem cupidatat commodo. Elit sunt amet fugiat veniam occaecat fugiat."
                }
                onChange={(newtext) => setAttributes({ contentUE: newtext })}
              />
            </p>
            <RichText
              value={attributes.contentUF}
              default={"    "}
              onChange={(newtext) => setAttributes({ contentUF: newtext })}
            />
          </div>
          <RichText
            value={attributes.contentUG}
            default={"    "}
            onChange={(newtext) => setAttributes({ contentUG: newtext })}
          />
          <div className="mt-8 lg:mt-0 lg:ml-8">
            <RichText
              value={attributes.contentUH}
              default={"      "}
              onChange={(newtext) => setAttributes({ contentUH: newtext })}
            />
            <form className="sm:flex">
              <RichText
                value={attributes.contentUI}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUI: newtext })}
              />
              <label for="email-address" className="sr-only">
                <RichText
                  value={attributes.contentUJ}
                  default={"Email address"}
                  onChange={(newtext) =>
                    setAttributes({ contentUJ: newtext })
                  }
                />
              </label>
              <RichText
                value={attributes.contentUK}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUK: newtext })}
              />
              <input
                id="email-address"
                name="email-address"
                type="email"
                autocomplete="email"
                required
                className="w-full px-5 py-3 border border-transparent placeholder-gray-500 focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white focus:border-white sm:max-w-xs rounded-md"
                placeholder="Enter your email"
              />
              <RichText
                value={attributes.contentUL}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUL: newtext })}
              />
              <div className="mt-3 rounded-md shadow sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                <RichText
                  value={attributes.contentUM}
                  default={"          "}
                  onChange={(newtext) =>
                    setAttributes({ contentUM: newtext })
                  }
                />
                <button
                  type="submit"
                  className="w-full flex items-center justify-center px-5 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-500 hover:bg-indigo-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-indigo-500"
                >
                  <RichText
                    value={attributes.contentUN}
                    default={"Notify me"}
                    onChange={(newtext) =>
                      setAttributes({ contentUN: newtext })
                    }
                  />
                </button>
                <RichText
                  value={attributes.contentUO}
                  default={"        "}
                  onChange={(newtext) =>
                    setAttributes({ contentUO: newtext })
                  }
                />
              </div>
              <RichText
                value={attributes.contentUP}
                default={"      "}
                onChange={(newtext) => setAttributes({ contentUP: newtext })}
              />
            </form>
            <RichText
              value={attributes.contentUQ}
              default={"      "}
              onChange={(newtext) => setAttributes({ contentUQ: newtext })}
            />
            <p className="mt-3 text-sm text-gray-300">
              <RichText
                value={attributes.contentUR}
                default={"We care about the protection of your data. Read our"}
                onChange={(newtext) => setAttributes({ contentUR: newtext })}
              />
              <a href="#" className="text-white font-medium underline">
                <RichText
                  value={attributes.contentUS}
                  default={" Privacy Policy. "}
                  onChange={(newtext) =>
                    setAttributes({ contentUS: newtext })
                  }
                />
              </a>
              <RichText
                value={attributes.contentt}
                default={"      "}
                onChange={(newtext) => setAttributes({ contentt: newtext })}
              />
            </p>
            <RichText
              value={attributes.contentUU}
              default={"    "}
              onChange={(newtext) => setAttributes({ contentUU: newtext })}
            />
          </div>
          <RichText
            value={attributes.contentUV}
            default={"  "}
            onChange={(newtext) => setAttributes({ contentUV: newtext })}
          />
        </div>
        <RichText
          value={attributes.contentUW}
          default={""}
          onChange={(newtext) => setAttributes({ contentUW: newtext })}
        />
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-gray-800">
       <RichText.Content value={attributes.contentUT}/>
        <div class="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8 lg:flex lg:items-center">
         <RichText.Content value={attributes.contentUA}/>
          <div class="lg:w-0 lg:flex-1">
           <RichText.Content value={attributes.contentUB}/>
            <h2
              class="text-3xl font-extrabold tracking-tight text-white sm:text-4xl"
              id="newsletter-headline"
            >
             <RichText.Content value={attributes.contentUC}/>
            </h2>
           <RichText.Content value={attributes.contentUD}/>
            <p class="mt-3 max-w-3xl text-lg leading-6 text-gray-300">
             <RichText.Content value={attributes.contentUE}/>
            </p>
           <RichText.Content value={attributes.contentUF}/>
          </div>
         <RichText.Content value={attributes.contentUG}/>
          <div class="mt-8 lg:mt-0 lg:ml-8">
           <RichText.Content value={attributes.contentUH}/>
            <form 
              action={attributes.action}
              method={attributes.method}
              class="sm:flex"
            >
              {arData.map((v) => {
                return <input type="hidden" name={v.name} value={v.val} />;
              })}

             <RichText.Content value={attributes.contentUI}/>
              <label for="email-address" class="sr-only">
               <RichText.Content value={attributes.contentUJ}/>
              </label>
             <RichText.Content value={attributes.contentUK}/>
              <input
                id="email-address"
                name="email-address"
                type="email"
                autocomplete="email"
                required
                class="w-full px-5 py-3 border border-transparent placeholder-gray-500 focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white focus:border-white sm:max-w-xs rounded-md"
                placeholder="Enter your email"
              />
             <RichText.Content value={attributes.contentUL}/>
              <div class="mt-3 rounded-md shadow sm:mt-0 sm:ml-3 sm:flex-shrink-0">
               <RichText.Content value={attributes.contentUM}/>
                <button
                  type="submit"
                  onclick={`sendEmail('${name}'); return false;`}
                  class="w-full flex items-center justify-center px-5 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-500 hover:bg-indigo-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-indigo-500"
                >
                 <RichText.Content value={attributes.contentUN}/>
                </button>
               <RichText.Content value={attributes.contentUO}/>
              </div>
             <RichText.Content value={attributes.contentUP}/>
            </form>
           <RichText.Content value={attributes.contentUQ}/>
            <p class="mt-3 text-sm text-gray-300">
             <RichText.Content value={attributes.contentUR}/>
              <a
                href={
                  attributes.contentUS.match('(.*?)href="(.*?)"(.*?)')
                    ? attributes.contentUS.match('(.*?)href="(.*?)"(.*?)')[2]
                    : attributes.contentUS
                }
                class="text-white font-medium underline"
              >
                {attributes.contentUS.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
                  ? attributes.contentUS.match(
                      "(?<=<.+.>)(.*?)(?=<.*/.+.?>)"
                    )[0]
                  : attributes.contentUS}
              </a>
             <RichText.Content value={attributes.contentt}/>
            </p>
           <RichText.Content value={attributes.contentUU}/>
          </div>
         <RichText.Content value={attributes.contentUV}/>
        </div>
       <RichText.Content value={attributes.contentUW}/>
      </div>
    );
  },
});
